app.run(function($ionicPlatform, Store, $translate, Message, ApiCaller, StateChecker, $rootScope) {//, Payment
  var modalshown = false;
  $ionicPlatform.ready(function() {

 		$translate.use(Store.langStore.getStorage());

    if (window.cordova && window.cordova.plugins && window.cordova.plugins.Keyboard) {
      window.FirebasePlugin.grantPermission();
      cordova.plugins.Keyboard.hideKeyboardAccessoryBar(true);
      cordova.plugins.Keyboard.disableScroll(true);
      onCordova(ApiCaller);
      // window.ga.startTrackerWithId('UA-64989876-22');
     	StateChecker.runStateChecker();
    }

    if (ionic.Platform.isAndroid()) {
      
      $rootScope.$on('modalshown', function() {
        modalshown = true;
      });

      $ionicPlatform.registerBackButtonAction(function (event) {
        event.preventDefault();
        if (modalshown) {
            $rootScope.$broadcast('modalhide');
            modalshown = false;
        }
        else {
          if ((window.history.state.state == "menu.home" && window.history.length <= 3) || window.history.length == 1) {
            Message.confirm("EXIT_APP")
            .then(function(res) {
              if (res) {
                navigator.app.exitApp();
              }
            });
          }
          else {
            window.history.go(-2);
          }
        }
      }, 999);
    }

    ApiCaller.callAPI('Greek', null, function(resp){
      Store.langStore.grkStorage(resp);
      $rootScope.$broadcast('$translateChangeSuccess');
      langup();
    },function(err){

    });
	
    ApiCaller.callAPI('English', null, function(resp){
      Store.langStore.engStorage(resp);
      $rootScope.$broadcast('$translateChangeSuccess');
      langup();
    },function(err){

    });

    $rootScope.$on('$translateChangeSuccess', function () {
      getAllMenu();
    });

    function getAllMenu() {
      ApiCaller.callAPI('Categories', null, function(response){
        if (response.status === "success") {
          Store.categories.setStorage(response.data.category);

          ApiCaller.callAPI('CategoryMenu', null, function(response){
            if (response.status === "success") {
              Store.menus.setStorage(response.data.menu);
            }
          },function(error) {
            console.log(error);
          });
        }
        else {
        }					
      },function(error) {
        console.log(error);
      });
    }
    getAllMenu();

    document.addEventListener("resume", function(){
      ApiCaller.callAPI('VerifyFCM', null, function(resp){
        if (resp.status == 'error') {
          onCordova($rootScope, ApiCaller);
        }
      },function(err){
        console.log(JSON.stringify(err));
      });
      
    }, false);

    if (window.StatusBar) {
      // org.apache.cordova.statusbar required
      StatusBar.styleDefault();
    }
  });
})

.config(function ($httpProvider) {
	$httpProvider.defaults.headers.post['Content-Type'] =  'application/x-www-form-urlencoded';
});

function onCordova(ApiCaller) {
  window.FirebasePlugin.getToken(
		function(token){
			if (token) {
				window.sessionStorage.setItem('fcm_token', token);
				ApiCaller.callAPI('TokenUpdate', {'firebasetoken': token}, function(resp){
					console.log(JSON.stringify(resp));
				},function(err){
					console.log(JSON.stringify(err));
				});
				tokenRec();
			}
		},
		function(err){
			console.log('error retrieving token: ' + err);
		}
  );

  window.FirebasePlugin.onTokenRefresh(function(token) {
    // save this server-side and use it to push notifications to this device
    if (token) {
				window.sessionStorage.setItem('fcm_token', token);
				ApiCaller.callAPI('TokenUpdate', {'firebasetoken': token}, function(resp){
					console.log(JSON.stringify(resp));
				},function(err){
					console.log(JSON.stringify(err));
				});
				tokenRec();
    }
  }, function(error) {
      console.error(error);
  });

	function tokenRec() {
		  window.FirebasePlugin.onNotificationOpen(
        function(data){
          // $rootScope.$broadcast('notrec');
          console.log( JSON.stringify(data) );
        },
        function(msg){
          console.log('onNotification callback successfully registered: ' + msg);
        },
        function(err){
          console.log('Error registering onNotification callback: ' + err);
        }
			);
	}

  app.config(function($cordovaFacebookProvider) {
		var appID = 1078262508889226;
	    var version = ""; // or leave blank and default is v2.0
	    $cordovaFacebookProvider.browserInit(appID, version);
	});
}